import React, { Component } from "react";
import ReactGA from "react-ga";
import $ from "jquery";
import "./App.css";
import Header from "./Components/Header";
import Footer from "./Components/Footer";
import About from "./Components/About";
import Resume from "./Components/Resume";
import Contact from "./Components/Contact";
import Portfolio from "./Components/Portfolio";

const App = () => {
  const mainn = {
    name: "Nordic-Giant Project",
    description:
      "I am a web development engineer and I use react and vue.js to develop pages. This project is a resume template that can be used as the project home page or resume page",
    image: "profilepic.jpg",
    bio: "Use this bio section as your way of describing yourself and saying what you do, what technologies you like to use or feel most comfortable with, describing your personality, or whatever else you feel like throwing in.",
    contactmessage:
      "Here is where you should write your message to readers to have them get in contact with you.",
    email: "youremailhere@gmail.com",
    phone: "555-555-5555",
    github: "https://github.com/nordicgiant2/react-nice-resume",
    project: "https://github.com/nordicgiant2/react-nice-resume",
    address: {
      street: "(Your Street)",
      city: "(Your City)",
      state: "(Your State)",
      zip: "(Your Zip/Postal Code)",
    },
  };

  const resu = {
    skillmessage:
      "Here you can create a short write-up of your skills to show off to employers",
    education: [
      {
        school: "University?",
        degree: "Masters in Beer tasting",
        graduated: "April 2017",
        description:
          "Describe your experience at school, what you learned, what useful skills you have acquired etc.",
      },
      {
        school: "School #1 Maybe College?",
        degree: "What did you study 101",
        graduated: "March 2013",
        description:
          "Describe your experience at school, what you learned, what useful skills you have acquired etc.",
      },
    ],
    work: [
      {
        company: "Awesome Design Studio",
        title: "Senior UX God ",
        years: "March 2018 - Present",
        description:
          "Describe work, special projects, notable achievements, what technologies you have been working with, and anything else that would be useful for an employer to know.",
      },
      {
        company: "Super Cool Studio",
        title: "Junior bug fixer",
        years: "March 2017 - February 2018",
        description:
          "Describe work, special projects, notable achievements, what technologies you have been working with, and anything else that would be useful for an employer to know.",
      },
    ],
    skills: [
      {
        name: "Python",
        level: "60%",
      },
      {
        name: "VueJs",
        level: "55%",
      },
      {
        name: "ReactJs",
        level: "50%",
      },
      {
        name: "CSS",
        level: "90%",
      },
      {
        name: "PHP",
        level: "80%",
      },
      {
        name: "Swift",
        level: "50%",
      },
      {
        name: "JAVA",
        level: "80%",
      },
    ],
  };

  const porto = {
    projects: [
      {
        title: "Canadian Wanderlust",
        category: "My Travel Blog for my post-university travels",
        image: "01.jpg",
        url: "https://www.canadianwanderlust.com",
      },
      {
        title: "Fury Fighting Gear",
        category: "(offline now) A fighting gear company I started",
        image: "02.jpg",
        url: "http://www.timbakerdev.com",
      },
      {
        title: "Original Thai Food",
        category: "Website I built for a restaurant I like in Thailand",
        image: "03.jpg",
        url: "http://www.timbakerdev.com/originalthaifood.github.io",
      },
      {
        title: "Resume Website",
        category: "A React based resume website template",
        image: "04.jpg",
        url: "http://www.timbakerdev.com",
      },
      {
        title: "Smirkspace",
        category:
          "(MVP Only) A React and Meteor based chat University project.",
        image: "05.jpg",
        url: "http://www.smirkspace.com",
      },
      {
        title: "Canadian Wanderlust",
        category: "My Travel Blog for my post-university travels",
        image: "06.jpg",
        url: "https://www.canadianwanderlust.com",
      },
      {
        title: "Fury Fighting Gear",
        category: "(offline now) A fighting gear company I started",
        image: "01.jpg",
        url: "http://www.timbakerdev.com",
      },
      {
        title: "Original Thai Food",
        category: "Website I built for a restaurant I like in Thailand",
        image: "02.jpg",
        url: "http://www.timbakerdev.com/originalthaifood.github.io",
      },
      {
        title: "Original Thai Food",
        category: "Website I built for a restaurant I like in Thailand",
        image: "03.jpg",
        url: "http://www.timbakerdev.com/originalthaifood.github.io",
      },
      {
        title: "Resume Website",
        category: "A React based resume website template",
        image: "04.jpg",
        url: "http://www.timbakerdev.com",
      },
      {
        title: "Smirkspace",
        category:
          "(MVP Only) A React and Meteor based chat University project.",
        image: "05.jpg",
        url: "http://www.smirkspace.com",
      },
      {
        title: "Canadian Wanderlust",
        category: "My Travel Blog for my post-university travels",
        image: "06.jpg",
        url: "https://www.canadianwanderlust.com",
      },
    ],
  };

  return (
    <div className="App">
      <Header data={mainn} />
      <About data={mainn} />
      <Resume data={resu} />
      <Portfolio data={porto} />
      <Contact data={mainn} />
      <Footer data={mainn} />
    </div>
  );
};

export default App;
